import React from "react"

function ColorGradient() {
  return (
    <canvas id="myCanvas" width="200" height="100"
    style={{border: '1 solid #d3d3d3'}}>
    Your browser does not support the canvas element.
    </canvas>
  );
}

export default ColorGradient;
